        <img src={badge} alt={"뱃지이미지"}></img>
        <img src={badge} alt={"뱃지이미지"}></img>
        <img src={badge} alt={"뱃지이미지"}></img>
        <img src={badge} alt={"뱃지이미지"}></img>
      </Container>
    </div>
  );
};
export default BadgeInfo;
